import React, { useState, useEffect } from "react";

function Profile(props) {
  
   


  return (
    <div className="Profile">
        <div>Name</div>
        <input type="text" value={props.name}></input>{console.log(props.name)}
        <div>User name</div>
        <input type="text"></input>
        <div>E-mail</div>
        <input type="text"></input>
        <div>Street</div>
        <input type="text"></input>
        <div>City</div>
        <input type="text"></input>
        <div>Zip code</div>
        <input type="text"></input>
        <div>Phone</div>
        <input type="text"></input>
        <div>Website</div>
        <input type="text"></input>
        <div>Comment</div>
        <input type="text"></input>
    </div>
  );
}

export default Profile;
